import React from "react";
import "../CSS/task.css";

interface taskProp {
  name: String;
  dueDate: Date;
  important: Boolean;
  repeat: Boolean;
  completed: Boolean;
  taskID: String;
}

function task({
  name,
  dueDate,
  important,
  repeat,
  completed,
  taskID,
}: taskProp) {
  return (
    <div className="task">
      <div className="task-first-container">
        <div className="tick">
          <img src="../Images/tick.png" alt="tick" />
        </div>
        <div>
          <div className="task-first-container-name">UIUX Course</div>
          <div className="task-first-container-date">Wed, 31 may</div>
        </div>
      </div>
      <div className="task-star">
        <img src="../Images/star-On.png" alt="star" />
      </div>
    </div>
  );
}
